import React from 'react';
import Gallery from 'react-grid-gallery';
import imagem1 from '../../../imagens/galerias/Sintomas Cancro de Papel/1.jpg';
import imagem2 from '../../../imagens/galerias/Sintomas Cancro de Papel/2.JPG';
import imagem3 from '../../../imagens/galerias/Sintomas Cancro de Papel/3.JPG';
import imagem4 from '../../../imagens/galerias/Sintomas Cancro de Papel/4.JPG';
import imagem5 from '../../../imagens/galerias/Sintomas Cancro de Papel/5.JPG';
import imagem6 from '../../../imagens/galerias/Sintomas Cancro de Papel/6.JPG';
import imagem7 from '../../../imagens/galerias/Sintomas Cancro de Papel/7.JPG';
import imagem8 from '../../../imagens/galerias/Sintomas Cancro de Papel/8.JPG';

const IMAGES =
        [{

                thumbnail: imagem1,
                src: imagem1,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem2,
                thumbnail: imagem2,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem3,
                thumbnail: imagem3,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem4,
                thumbnail: imagem4,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem5,
                thumbnail: imagem5,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem6,
                thumbnail: imagem6,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem7,
                thumbnail: imagem7,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        },

        {
                src: imagem8,
                thumbnail: imagem8,
                thumbnailWidth: 320,
                thumbnailHeight: 174,
        }]

const CancroPapel = () => (
        <div>
                <h5 className="subtitle center-align">Sintomas do Cancro de Papel</h5>
                <Gallery images={IMAGES} enableLightbox={true}/>
        </div>
);

export default CancroPapel
